import React, {Component} from 'react';
import YoutubeComp from '../../component/YoutubeComponent/YoutubeComp';

class Home extends Component{
    render(){
        return (
            <div>
                <p>Youtube Component</p>
                <br/>
                <YoutubeComp 
                time = '7.12' 
                title = 'belajar reactjs bagian - 1' desc ='belajar reactjs bersama channel prawito hudoro'/>
                <YoutubeComp 
                time = '6.12' 
                title = 'belajar reactjs bagian - 2' desc ='belajar reactjs bersama channel prawito hudoro'/>
                <YoutubeComp 
                time = '5.12' 
                title = 'belajar reactjs bagian - 3' desc ='belajar reactjs bersama channel prawito hudoro'/>
                <YoutubeComp 
                time = '4.12' 
                title = 'belajar reactjs bagian - 4' desc ='belajar reactjs bersama channel prawito hudoro'/>
                <YoutubeComp 
                title = 'belajar reactjs bagian - 5' desc ='belajar reactjs bersama channel prawito hudoro'/>
            </div>
        )
    }
}

export default Home;
